export default function Trading() {

// let trading = new TradingViewWidget("")
const Trading = new TradingViewWidget
let small = Trading.width = '800px'
let themey = Trading.theme = 'Dark'
let indicators =  Trading.studies = [ "ROC@tv-basicstudies", "StochasticRSI@tv-basicstudies",  "MASimple@tv-basicstudies"]

console.log(Trading)
console.log(typeof Trading)
console.log(Trading.width)
console.log(indicators[0])

return (
<div>

<div className="Navbar">
<button type="submit" onClick={handleAdd}>ETH</button>
  <a href="">Large Caps</a>

  <a href="#news">Medium Caps</a>
  <a href="#contact">Small Caps</a>
  <a href="#home">SHORTS VS LONGS</a>
  <a href="#news">CoinFarm</a>
  <a target="_blank" href="http://data.bitcoinity.org/markets/bidask_sum/7d/USD/coinbase?bp=5&bu=c&t=m"> Bids vs Sums</a>
  <a href="#contact">Big Picture</a>
  <a href="#contact">Trades</a>
</div>

<TradingViewWidget

    symbol={symbol}
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='D'
    studies={indicators}  
    width={width}
    height={heighty}  
        // rangeTypes='ALL' 
      // autoSize='true'   
/>

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='W'
    studies={indicators}  

  />

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
